import React from "react";
import "./Contact.css";

function Contact() {
    return (
        <section id="contact" className="contact-container">
            <h2>Contact</h2>
            <ul>
                <li>
                    <i className="fas fa-envelope"></i>
                    <a href="mailto:drxckpro123@gmail.com">drxckpro123@gmail.com</a>
                </li>
            </ul>
        </section>
    );
}

export default Contact;
